Hello guys… here is a snippet of the training we are attending with @bazevents in Beirut Lebanon. Organized by @ahemconference_  of @thechimeracompany 

Mr Baz took us on a journey from the  developing of concepts to the final design of an event.. real time negotiations with 3rd party suppliers and equipping us with his wealth of experience in event production. 

@condollezzaevents @nunuderon_events @365eventsgh @fabueventsltd

This is the future of event Design! This internship has really opened my mind and imagination of what event production  can be. So glad to have watched this set up come to life, at first we were all worried that there wasn’t going to be any flowers and even mr Baz said it was quite a challenge for him. It all came together beautifully. 

So inspired to do more!! 

@ahemconference_ thank you for making this internship available for us and you did this for the industry for everyone to upscale their events… the world isn’t ready for your ideas ❤️

@bazevents you are a genius ❤️❤️❤️ we had all access you your event and we saw how passionate you are towards each element of your event. We learnt the business side of event production and not just design but finishing. This was a wonderful opportunity and will do it again and again… we experienced our first labanese wedding and it was a total vibe! Thank you 🙏

